import styled from "styled-components";

export const LoginButton = styled.button`
  width: 100%;
  background: linear-gradient(90deg, #FF2D04 0%, #C13216 100%);
  height: 65px;
  border: none;
  border-radius: 50px;
  color:  #FFFFFF;
`
